import styled from "styled-components";

const SearchStyled = styled.input`
  border-radius: 5px;
  border: 1px solid #dcdde1;
  height: 2em;
  width: 400px;
  display: flex;
  justify-content: center;
  align-items: center;
  outline: none;
`;

export default SearchStyled;
